import { BrowserRouter as Router, Routes, Route, NavLink } from 'react-router-dom';

function App() {
  return (
    <Router>
      <nav style={{ padding: '1rem', backgroundColor: '#006400' }}>
        <NavLink
          to="/"
          style={({ isActive }) => ({
            marginRight: '1rem',
            padding: '0.5rem 1rem',
            textDecoration: 'none',
            backgroundColor: isActive ? '#66BB6A' : 'transparent',
            color: isActive ? '#00008B' : '#ffffff',
            borderRadius: '4px'
          })}
          end
        >
          Dashboard
        </NavLink>
        <NavLink
          to="/event-sender"
          style={({ isActive }) => ({
            marginRight: '1rem',
            padding: '0.5rem 1rem',
            textDecoration: 'none',
            backgroundColor: isActive ? '#66BB6A' : 'transparent',
            color: isActive ? '#00008B' : '#ffffff',
            borderRadius: '4px'
          })}
        >
          Event Sender
        </NavLink>
        <NavLink
          to="/preview"
          style={({ isActive }) => ({
            padding: '0.5rem 1rem',
            textDecoration: 'none',
            backgroundColor: isActive ? '#66BB6A' : 'transparent',
            color: isActive ? '#00008B' : '#ffffff',
            borderRadius: '4px'
          })}
        >
          Preview
        </NavLink>
      </nav>
      <Routes>
        {/* Define your routes here */}
      </Routes>
    </Router>
  );
}

export default App;
